import Expenses from "./expenses/Expenses.js";

function Card() {
 
  return (
    <div className="expenses-container">

   <ol>{
  expenses.map(el=>{
    return ( <li key={el.key}><ExpenseItem key={el.key} date={el.date} title={el.title} amount={el.amount}></ExpenseItem></li>);
  })
}</ol>
</div>
  );
}

export default Expenses;
